import React from 'react';
import { YMaps, Map, Placemark } from 'react-yandex-maps';

const Google = () => {
  const placemarks = [
    { id: 1, coordinates: [55.751244, 37.618423] }, // Moscow
    { id: 2, coordinates: [48.8566, 2.3522] },       // Paris
    { id: 3, coordinates: [40.7128, -74.0060] },     // New York
    { id: 4, coordinates: [-33.8688, 151.2093] }     // Sydney
  ];

  return (
    <YMaps>
      <Map
        defaultState={{ center: [55.751244, 37.618423], zoom: 3 }}
        style={{ width: '100%', height: '400px' }}
      >
        {/* Render Placemarks */}
        {placemarks.map(placemark => (
          <Placemark
            key={placemark.id}
            geometry={placemark.coordinates}
            options={{ draggable: true }}
            properties={{
              hintContent: 'Placemark ' + placemark.id,
              balloonContent: 'Coordinates: ' + placemark.coordinates.join(',salom ')
            }}
          />
        ))}
      </Map>
    </YMaps>
  );
};

export default Google;
